use std::{ops::MulAssign, collections::HashMap};
use rug::Integer;


fn binary_(base: &Integer, exponent: &Integer, cache: &mut HashMap<Integer, Integer>) -> Integer {
    if *exponent == Integer::from(0) {
        return Integer::from(1);
    }

    if *exponent == Integer::from(1) {
        return base.clone();
    }

    let mut result = base.clone();
    let mut exp = Integer::from(2u64);

    let from_cache = cache.get(exponent);

    if let Some(cache_hit) = from_cache {
        return cache_hit.clone();
    } 

    while exp <= *exponent {
        println!("exp = {}", exp);
        
        let from_cache = cache.get(&exp);

        if let Some(cache_hit) = from_cache {
            result = cache_hit.clone();
        } else {
            result.mul_assign(result.clone());
        }
        exp = exp << 1;
    }

    exp = exp >> 1;

    if exp < *exponent {
        let expo = exponent - exp;
        let rest = binary_(base, &expo, cache);
        result = &result * rest;
    }

    result
}

pub fn binary(base: &Integer, exponent: &Integer) -> Integer {
    let mut cache = HashMap::new();
    binary_(base, exponent, &mut cache)
}

